    "loyalty-myaccount-index": {
        "results": {
            "myAccountHeroImage": {
                "modDate": 1713188258945,
                "index": "content-service-placements-idx-proda-v20240529",
                "id": "l2f3a40o-desktop",
                "lang": "en",
                "type": "flex-placement",
                "content": {
                    "displayType": "background",
                    "src": "/swa-resources/images/heroes/myaccount_responsive/overhead_surf.jpg",
                    "imageContrast": "light",
                    "styles": {}
                }
            },
            "rrSummaryChaseCompanionQualifyingPointsInfo": {
                "modDate": 1676476388280,
                "index": "content-service-placements-idx-proda-v20240529",
                "id": "lb1944ii",
                "lang": "en",
                "type": "text-block",
                "content": {
                    "displayType": "text-block",
                    "text": [
                        {
                            "color": "neutral-gray4",
                            "block": true,
                            "value": "<p style=\"font-size: .75rem; font-color: #0B142D; line-height: 1rem;\">Members with an open Southwest<sup style=\"line-height: .05em;\">&reg;</sup> Rapid Rewards<sup style=\"line-height: .05em;\">&reg;</sup> Credit Card on the first business day of each calendar year will earn one boost of 10,000 Companion Pass<sup style=\"line-height: .05em;\">&reg;</sup> qualifying points each calendar year. The boost will be deposited into eligible Member's account by January 31 of the calendar year. When a Member opens a Rapid Rewards Credit Card after the first business day of the calendar year, they will receive one boost of 10,000 Companion Pass qualifying points up to 30 days after opening the Rapid Rewards Credit Card. <a href=\"https://www.southwest.com/rapidrewards/tiers-more-companion-pass\" aria-label=\"More details about Companion Pass\"  target=\"_blank\" rel=\"noopener noreferrer\">More details</a>.</p>",
                            "font": "font-12"
                        }
                    ]
                }
            },
            "rrSummaryMemberStatusInfoBox": {
                "modDate": 1704088853883,
                "index": "content-service-placements-idx-proda-v20240529",
                "id": "lb1944j3",
                "lang": "en",
                "type": "text-block",
                "content": {
                    "displayType": "text-block",
                    "text": [
                        {
                            "color": "secondary-gray",
                            "block": true,
                            "value": "<p>A Member who flies 20 qualifying one-way flight segments<sup style=\"line-height: 0.6em;\" aria-hidden=\"true\">1</sup> booked through Southwest Airlines or earns 35,000 tier qualifying points<sup style=\"line-height: 0.6em;\" aria-hidden=\"true\">2</sup> per calendar year will qualify for A-List status. <span class=\"swa-g-screen-reader-only\">More information about tier qualifying flights and tier qualifying points at the end.</span></p>\n<p>A Member who flies 40 qualifying one-way flight segments booked through Southwest Airlines or earns 70,000 tier qualifying points per calendar year will qualify for A-List Preferred status. <a href=\"https://www.southwest.com/rapidrewards/tiers-more-alist\" aria-label=\"More details\"  target=\"_blank\" rel=\"noopener noreferrer\">More details</a>.</p>",
                            "font": "font-13"
                        },
                        {
                            "color": "secondary-gray",
                            "block": true,
                            "value": "<p><sup aria-hidden=\"true\">1</sup> Tier qualifying flights are revenue flights purchased and flown.</p>\n<p><sup aria-hidden=\"true\">2</sup> Tier qualifying points are earned from revenue flights during the qualifying year or through select Rapid Rewards Credit Cards from Chase and are exclusive of bonuses or promotions.</p>",
                            "font": "font-11"
                        }
                    ]
                }
            },
            "rrSummaryCompanionStatusInfoBox": {
                "modDate": 1676476388969,
                "index": "content-service-placements-idx-proda-v20240529",
                "id": "lb1944ih",
                "lang": "en",
                "type": "text-block",
                "content": {
                    "displayType": "text-block",
                    "text": [
                        {
                            "color": "secondary-gray",
                            "block": true,
                            "value": "<p>When you earn Companion Pass status, one person of your choice can fly with you any time for an entire calendar year. Rapid Rewards Members simply need to fly 100 qualifying one-way flights or earn 135,000 qualifying points from flights or partners in one calendar year to earn Companion Pass. <a href=\"https://www.southwest.com/rapidrewards/tiers-more-companion-pass\" aria-label=\"More details\"  target=\"_blank\" rel=\"noopener noreferrer\">More details</a>.</p>",
                            "font": "font-13"
                        }
                    ]
                }
            }
        }
    },
